import { StyleSheet, Text, View, TextInput } from 'react-native'
import React from 'react'

const Search = () => {
  return (
    <View style={s.container}>
      <View></View>
      <View></View>
    </View>
  )
}

export default Search

const s = StyleSheet.create({})
